import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Dashboard from './components/dashboard/Dashboard';
import HomeView from './components/dashboard/views/HomeView';
import MerchantsView from './components/dashboard/views/MerchantsView';
import DonationsView from './components/dashboard/views/DonationsView';

function App() {
  return (
    <Router>
      <div className="App min-h-screen">
        <Routes>
          <Route path="/" element={<Dashboard />}>
            <Route index element={<Navigate to="/home" replace />} />
            <Route path="home" element={<HomeView />} />
            <Route path="merchants" element={<MerchantsView />} />
            <Route path="donations" element={<DonationsView />} />
          </Route>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
